import React from 'react';
import './List.scss';
import { ListSelection } from '../List-Selection/List-Selection';

export class List extends React.Component<{name: string, listItems: string[]}> {
    render() {
        return (
            <div className="List">
                <h2>{this.props.name}</h2>
                {this.props.listItems.map((listItem: string, index: number) => {
                    return (<ListSelection key={index} name={listItem}></ListSelection>)
                })}
            </div>
        );
    }
};
